    return <Home />
  }

  renderAboutMe = () => {
    <About />
  }

  render() {
    return (
      <div id="App">
        <BrowserRouter>
          <div>
            <SideBar />
            <Main>
              <Switch>
                <Route exact path="/" component={Home} />
